export default {
  data() {
    return {
      ready: false,
      loading: true
    };
  },

  created() {
    let gps_web_url = "http://" + location.host;
    let gps_xhyc_url = window.location.href;

    if (location.host == 'localhost:8081' || location.host == '192.168.2.25:8081') {
      // 本地测试
      let hash = location.hash.replace('#/', ''); // 演示

      gps_web_url = 'http://47.92.193.174/:8085';
      gps_xhyc_url = `http://47.92.193.174/:8085?userId=admin&page=${hash}`;
    }

    window.$_main.init(gps_web_url, gps_xhyc_url);
  },

  beforeDestroy() {
    window.$_main.exit();
  },

  mounted() {
    this.ready = true;
    this.$router.push({
      path: window.$_main.page
    }).catch(err => err);
    this.$router.onReady(() => this.loading = false);
  }

};
